import React from "react";
import { Divider } from "antd";
import { Link } from "react-router-dom";
import Car from "../../components/Carousel/Carousel";
import FeaturedAttractions from "../../components/FeaturedAttractions/featuredAttractions";
import TravelTips from "../../components/TravelTips/travelTips";

const Divide = () => (
  <>
    <Divider
      orientation="left"
      style={{ borderColor: "#4682B4", marginTop: "10px" }}>
      <Link to="/temple" className="l1" style={{ margin: "0 55px" }}>
        Իսկ դուք գիտեի՞ք, որ․․․
      </Link>
    </Divider>
  </>
);

const Homepage = () => {
  return (
    <div className="homepage">
      <div className="welcome-text-container">
        <h2>Բարի գալուստ BeeWeb_Task</h2>
      </div>
      <FeaturedAttractions />
      <Divide />
      <TravelTips />
      <div style={{ width: "100%", height: "600px", marginBottom: "30px" }}>
        <iframe
          style={{ width: "100%", height: "100%" }}
          src="https://maps.google.com/maps?width=100%25&amp;height=600&amp;hl=en&amp;q=armenia+(My%20Business%20Name)&amp;t=&amp;z=8&amp;ie=UTF8&amp;iwloc=B&amp;output=embed"
          title="Map of Armenia"
          frameBorder="0"
          scrolling="no"
          marginHeight="0"
          marginWidth="0">
          <a href="https://www.gps.ie/">gps systems</a>
        </iframe>
      </div>
    </div>
  );
};

export { Homepage };
